import React from 'react';

import './card.styles.css';

export const Card = props => (
  <div className='card-container temp_container'>

    <h2>{props.daily.temp.day.toFixed()}</h2>
    <div>
      {<img
      alt='monster'
      src={`${props.daily.weather.icon}.png`}
    />}
    <p>{props.daily.humidity} </p>
    </div>

  </div>
);
